import React, {useState} from "react";
import Modal from '@mui/material/Modal/index';

const AppModal = ({children}) => {

    return (

        <Modal
        open={true}
        onClose={false}
        aria-labelledby="modal-modal-title"
        aria-describedby="modal-modal-description"
        >
       {children}
        </Modal>
    )



}


export default AppModal;
